import React, { Component } from 'react';

class Checkout extends Component {
  state = {  }
  render() {
    return (
      <table>
        <tbody>
          <tr>
            <td>
              <table>
                <tbody>
                  <tr><td><span>Qty </span><span>0</span></td></tr>
                  <tr><td><span>Total </span><span>0</span></td></tr>
                </tbody>
              </table>
            </td>
            <td><button>Check Out</button></td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default Checkout;
